    public static String[] parseOrcRow(String currentRow) {
        char INITIAL_STATE = ' ';
        ArrayList<String> columns = new ArrayList<String>();
        char complexTypeIndicate = INITIAL_STATE ;
        StringBuilder token = new StringBuilder();

        // go through each char except first and last one.
        for (int i = 1; i < currentRow.length() -1; i++) {
            char c = currentRow.charAt(i);
            if ( (c == '{' || c == '[') && complexTypeIndicate == INITIAL_STATE) {
                // enter into complex type
                complexTypeIndicate = c;
            }
            else if (c == '}' && complexTypeIndicate == '{') {
                // get out from struct or map
                complexTypeIndicate = INITIAL_STATE;
            }
            else if (c == ']' && complexTypeIndicate == '[') {
                // get out from array
                complexTypeIndicate = INITIAL_STATE;
            }
            else if (c == ',' && complexTypeIndicate == INITIAL_STATE) {
                // build the column from current token
                columns.add(token.toString().trim());
                token.setLength(0); // reset it for next token
            }
            else {
                // add char to token for every other case.
                token.append(c);
            }
        }

        // process the last token
        columns.add(token.toString().trim());

        return columns.toArray(new String[columns.size()]);
    }

